import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

export default function WeatherIcon(weatherDisp){
  switch (weatherDisp){
    case (weatherDisp) == 'Clear':
      weatherDisp = "cloud-showers-heavy";
      break;
    case (weatherDisp) == 'Rain':
      weatherDisp = "cloud-showers-heavy";
      break;
    case (weatherDisp) == 'Clouds':
      weatherDisp = "cloudy";
      break;
    default:
      console.log('Sorry, we are missing the icon for ' + weatherDisp + '.');
  }
  return (
    <div>
      Display weather: <FontAwesomeIcon icon ={weatherDisp} />
    </div>
  );
}
